import React, { useEffect } from 'react';
import { Link } from 'react-router-dom';
import AboutPhoto from './images/About.jpg';
import "./ProjectSection.css";
import AOS from 'aos';
import 'aos/dist/aos.css';

function ProjectSection () {

    {/* Scroll Animation */ }
    useEffect(() => {
        AOS.init({ duration: 1500 });
    })
    
    return (
        <section className="about-section" id="project">
            <div className="about-heading" data-aos="zoom-in">
                <h2>03. Projects</h2>
            </div>
            
            <div className="card">
                <img src={imageSrc} alt={imageAlt} className="card-image" />
                <div className="card-content">
                    <h3 className="card-title">{title}</h3>
                    <p className="card-description">{description}</p>
                    <a href="" className="card-link">{linkText}</a>
                </div>
            </div>
        </section>
    )
}

export default ProjectSection
